/* eslint-disable */

// 矩形树图图生成器
export default function treemapOption(config, fileDataMap, xData, yDataArr, selectedChartType, seriesData, customOption = {}) {
    console.log('[--debugInput {Treemap Chart Options}--] config:', config);
    console.log('[--debugInput {Treemap Chart Options}--] fileDataMap:', fileDataMap);
    console.log('[--debugInput {Treemap Chart Options}--] xData:', xData);
    console.log('[--debugInput {Treemap Chart Options}--] yDataArr:', yDataArr);
    console.log('[--debugInput {Treemap Chart Options}--] selectedChartType:', selectedChartType);
    console.log('[--debugInput {Treemap Chart Options}--] seriesData:', seriesData);
    console.log('[--debugInput {Treemap Chart Options}--] customOption:', customOption);
    return {}
}
